{% block title %}User{% endblock %}

{% block body %}
    <h1>User</h1>

    <table class=\"table\">
        <tbody>
            <tr>
                <th>Id</th>
                <td>{{ user.id }}</td>
            </tr>
            <tr>
                <th>Email</th>
                <td>{{ user.email }}</td>
            </tr>
            <tr>
                <th>Roles</th>
                <td>{{ user.roles ? user.roles|json_encode : '' }}</td>
            </tr>
            <tr>
                <th>Password</th>
                <td>{{ user.password }}</td>
            </tr>
            <tr>
                <th>Login</th>
                <td>{{ user.login }}</td>
            </tr>
            <tr>
                <th>Picture</th>
                <td>{{ user.picture }}</td>
            </tr>
            <tr>
                <th>LastName</th>
                <td>{{ user.lastName }}</td>
            </tr>
            <tr>
                <th>FirstName</th>
                <td>{{ user.firstName }}</td>
            </tr>
            <tr>
                <th>Training</th>
                <td>{{ user.training }}</td>
            </tr>
            <tr>
                <th>BirthDate</th>
                <td>{{ user.birthDate ? user.birthDate|date('Y-m-d') : '' }}</td>
            </tr>
            <tr>
                <th>Phone</th>
                <td>{{ user.phone }}</td>
            </tr>
            <tr>
                <th>ActualJob</th>
                <td>{{ user.actualJob }}</td>
            </tr>
            <tr>
                <th>Links</th>
                <td>{{ user.links }}</td>
            </tr>
            <tr>
                <th>LastConnection</th>
                <td>{{ user.lastConnection ? user.lastConnection|date('Y-m-d') : '' }}</td>
            </tr>
            <tr>
                <th>RegistrationDate</th>
                <td>{{ user.registrationDate ? user.registrationDate|date('Y-m-d') : '' }}</td>
            </tr>
            <tr>
                <th>ArchivingDate</th>
                <td>{{ user.archivingDate ? user.archivingDate|date('Y-m-d') : '' }}</td>
            </tr>
            <tr>
                <th>Desactivation</th>
                <td>{{ user.desactivation ? 'Yes' : 'No' }}</td>
            </tr>
            <tr>
                <th>NotificationCount</th>
                <td>{{ user.notificationCount }}</td>
            </tr>
        </tbody>
    </table>

    <a href=\"{{ path('user_index') }}\">back to list</a>

